import './ExpenseForm.css';
import React from "react";
const ExpenseForm =()=>{
const titleChangeHandler=()=>{
    console.log(e.target.value);
};


    return(
        <form>
            <div className='new-expense__controls'>
                <div className='new-expense__control'></div>
                 <label className='new-expense__control label'>title</label>
                 <input className='new-expense__control input' type='text' onChange={titleChangeHandler} />
                </div>
                <div className='new-expense__control'>
                 <label className='new-expense__control label'>Amount</label>
                 <input className='new-expense__control input' type='number' min="0.01" step='0.01'/>
                <div/>
                <div className='new-expense__control'>
                 <label className='new-expense__control label'>date</label>
                 <input className='new-expense__control input' type='date' min='2019-01-01' max='2022-12-30'/>
                </div>   
            </div>
            <div className='new-expense__actions'>
              <button type='submit'>Add Expense</button>
            </div>
            
        </form>
);
};
export default ExpenseForm;
